a4956f?s=96&d=monsterid&r=g\";s:12:\"display_name\";s:15:\"Jorge A. Torres\";}s:10:\"leifsinger\";a:3:{s:7:\"profile\";s:42:\"https://profiles.wordpress.org/leifsinger/\";s:6:\"avatar\";s:120:\"https://secure.gravatar.com/avatar/8107603a6bbc5ff73e07e2450f260335af41a5adb2cccd80cba20cdd28b96651?s=96&d=monsterid&r=g\";s:12:\"display_name\";s:11:\"Leif Singer\";}s:9:\"neosinner\";a:3:{s:7:\"profile\";s:41:\"https://profiles.wordpress.org/neosinner/\";s:6:\"avatar\";s:120:\"https://secure.gravatar.com/avatar/68b52d53a3c6dd39841f697853a1965057c6f3aeb9e89f7d960d1921ffa90d29?s=96&d=monsterid&r=g\";s:12:\"display_name\";s:13:\"Ján Mikláš\";}}s:8:\"requires\";s:3:\"6.6\";s:6:\"tested\";s:5:\"6.7.2\";s:12:\"requires_php\";s:3:\"7.4\";s:16:\"requires_plugins\";a:0:{}s:6:\"rating\";i:90;s:7:\"ratings\";a:5:{i:5;i:3680;i:4;i:182;i:3;i:98;i:2;i:105;i:1;i:400;}s:11:\"num_ratings\";i:4465;s:11:\"support_url\";s:49:\"https://wordpress.org/support/plugin/woocommerce/\";s:15:\"support_threads\";i:953;s:24:\"support_threads_resolved\";i:718;s:15:\"active_installs\";i:8000000;s:12:\"last_updated\";s:22:\"2025-04-09 11:56am GMT\";s:5:\"added\";s:10:\"2011-09-27\";s:8:\"homepage\";s:24:\"https://woocommerce.com/\";s:8:\"sections\";a:6:{s:11:\"description\";s:13000:\"<p><a href=\"https://woocommerce.com/woocommerce/\" rel=\"nofollow ugc\">WooCommerce</a> adalah platform ecommerce open source untuk WordPress.</p>\n<p>Platform inti kami gratis, fleksibel, dan diperkuat oleh komunitas global. Basis sumber terbuka berarti Anda mempunyai kepemilikan penuh atas konten dan data toko Anda selamanya.</p>\n<p>Untuk meluncurkan bisnis, mentransformasi toko fisik ke dunia online, maupun mengembangkan situs untuk klien, manfaatkan WooCommerce untuk membangun toko yang memadukan konten dan dagangan.</p>\n<ul>\n<li><strong>Buat etalase yang indah dan menarik</strong> dengan <a href=\"https://woocommerce.com/product-category/themes/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">tema</a>yang cocok dengan merek dan industri Anda.</li>\n<li><strong>Tingkatkan pendapatan</strong> dengan pengoptimalan <a href=\"https://woocommerce.com/checkout-blocks/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">pengalaman keranjang belanja</a> yang bisa dikonversi.</li>\n<li><strong>Sesuaikan halaman produk dalam hitungan menit</strong> menggunakan <a href=\"https://woocommerce.com/document/woocommerce-blocks/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">blok produk</a> modular.</li>\n<li>Pamerkan barang fisik dan digital, variasi produk, konfigurasi khusus, unduhan instan, dan item-item afiliasi.</li>\n<li>Jual <a href=\"https://woocommerce.com/products/woocommerce-subscriptions/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">langganan</a>, <a href=\"https://woocommerce.com/products/woocommerce-bookings/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">pemesanan</a>, atau <a href=\"https://woocommerce.com/products/woocommerce-memberships/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">keanggotaan</a> dengan ekstensi yang telah diperiksa pengembang kami.</li>\n<li><strong>Kembali ke hasil pencarian teratas</strong> dengan memanfaatkan <a href=\"https://www.searchenginejournal.com/wordpress-best-cms-seo/\" rel=\"nofollow ugc\">keuntungan SEO WordPress</a>.</li>\n<li><strong>Manfaatkan platform yang tumbuh bersama skala bisnis Anda.</strong> Dapatkan e-commerce fleksibel untuk <a href=\"https://woocommerce.com/high-volume-stores/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">toko skala besar</a>.</li>\n</ul>\n<h4>SEMUA ALAT YANG ANDA BUTUHKAN UNTUK BERJUALAN</h4>\n<p>Alat bawaan dan integrasi populer yang membantu Anda mengelola operasi bisnis secara efisien. Anda bebas menambahkan beragam layanan hanya dengan satu klik melalui <a href=\"https://woocommerce.com/document/woocommerce-setup-wizard/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Wizard Pengaturan</a> opsional.</p>\n<ul>\n<li><strong>Pilih cara pembayaran yang Anda inginkan</strong>. Kelola pembayaran dengan mudah dari toko Anda menggunakan <a href=\"https://woocommerce.com/payments/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">WooCommerce Payments</a> (Tersedia di AS, Inggris, Irlandia, Australia, Selandia Baru, Kanada, Spanyol, Prancis, Jerman, dan Italia). Terima pembayaran dengan aman menggunakan kartu kredit, dompet seluler, transfer bank, dan uang tunai berkat layanan dari <a href=\"https://woocommerce.com/product-category/woocommerce-extensions/payment-gateways/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">lebih dari 100 gateway pembayaran</a> – termasuk <a href=\"https://woocommerce.com/products/stripe/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Stripe</a>, <a href=\"https://woocommerce.com/products/woocommerce-gateway-paypal-checkout/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">PayPal</a>, dan <a href=\"https://woocommerce.com/products/square/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Square</a>.</li>\n<li><strong>Konfigurasikan pilihan pengiriman</strong>. Cetak label USPS langsung dari dasbor Anda, dan jadwalkan pengambilan dengan <a href=\"https://woocommerce.com/products/shipping/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">WooCommerce Shipping</a> (hanya AS). Hubungkan dengan <a href=\"https://woocommerce.com/product-category/woocommerce-extensions/shipping-methods/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">jasa ekspedisi terkemuka</a>, seperti UPS dan FedEx, serta berbagai solusi pengiriman, penyimpanan, dan pemenuhan barang untuk daerah Anda.</li>\n<li><strong>Sederhanakan pajak penjualan</strong>. Tambahkan <a href=\"https://woocommerce.com/products/tax/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Pajak WooCommerce</a> atau <a href=\"https://woocommerce.com/product-category/woocommerce-extensions/tax?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">layanan terintegrasi serupa</a> untuk membuat penghitungan otomatis.</li>\n</ul>\n<h4>Kembangkan bisnis Anda, tambahkan fitur, dan pantau toko Anda dari mana saja</h4>\n<p>WooCommerce bersungguh-sungguh melayani Anda. Pantau metrik performa yang paling penting bagi Anda dengan dasbor terpusat bawaan WooCommerce yang andal dan fleksibel.</p>\n<p>Perluas audiens di berbagai kanal pemasaran dan media sosial dengan integrasi <a href=\"https://woocommerce.com/products/google-ads/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Google Ads</a>, <a href=\"https://woocommerce.com/products/hubspot-for-woocommerce/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">HubSpot</a>, <a href=\"https://woocommerce.com/products/mailchimp-for-woocommerce/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Mailchimp</a>, dan <a href=\"https://woocommerce.com/products/facebook/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Facebook</a>. Anda selalu bisa memeriksa dasbor <a href=\"https://woocommerce.com/document/marketing-hub/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Hub Pemasaran</a> untuk mendapatkan ide segar dan tips yang dapat menunjang kesuksesan.</p>\n<p>Tingkatkan fungsionalitas toko dengan ratusan ekstensi gratis dan berbayar dari <a href=\"https://woocommerce.com/products/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Marketplace WooCommerce resmi</a>. Pengembang kami <a href=\"https://woocommerce.com/document/marketplace-overview/#section-6?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">memeriksa semua ekstensi baru</a> dan meninjau ekstensi yang sudah ada secara berkala untuk menjaga standar kualitas Marketplace. Kami secara aktif <a href=\"https://woocommerce.com/document/marketplace-overview/#section-2?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">mengembangkan produk yang dapat membantu para pembuat toko menciptakan toko yang sukses</a>.</p>\n<p>Kelola toko dari mana saja lewat <a href=\"https://woocommerce.com/mobile/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">aplikasi seluler</a> WooCommerce yang tersedia gratis (Android dan iOS). Awas spoiler: Anda akan mendengar suara pemberitahuan &#8220;cha-ching&#8221; tiap kali Anda melakukan penjualan!</p>\n<h4>Miliki dan kontrol data toko Anda – selamanya</h4>\n<p>Dengan <a href=\"https://woocommerce.com/woocommerce/\" rel=\"nofollow ugc\">WooCommerce</a>, data Anda menjadi milik Anda. Selalu.</p>\n<p>Jika Anda memilih untuk berbagi <a href=\"https://woocommerce.com/usage-tracking/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">data penggunaan</a> dengan kami, Anda tak perlu khawatir, karena data itu akan dianonimkan dan dijaga keamanannya. Anda dapat memilih untuk berhenti berbagi data kapan saja. Ini tidak akan memengaruhi toko Anda.</p>\n<p>Berbeda dari solusi hosting e-commerce, penyimpanan data WooCommerce tidak akan ketinggalan zaman. Anda bisa mengekspor semua konten dan memindahkan situs ke platform apa pun sesuai keinginan. Tanpa batasan.</p>\n<h4>Mengapa pengembang memilih (dan menyukai) WooCommerce</h4>\n<p>Pengembang dapat menggunakan <a href=\"https://woocommerce.com/woocommerce/\" rel=\"nofollow ugc\">WooCommerce</a> untuk membuat, melakukan kustomisasi, dan menyesuaikan skala toko menurut keinginan klien dengan cara menyediakan ekstensi atau solusi khusus untuk meningkatkan kualitas.</p>\n<ul>\n<li>Manfaatkan <a href=\"https://woocommerce.com/document/introduction-to-hooks-actions-and-filters/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">kait tindakan dan penyaring</a> untuk memodifikasi atau membuat fungsi.</li>\n<li>Integrasikan hampir semua layanan menggunakan <a href=\"https://developer.woocommerce.com/docs/getting-started-with-the-woocommerce-rest-api/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">REST API</a> dan webhook yang andal.</li>\n<li>Desain dan buat blok konten kustom dengan React.</li>\n<li><a href=\"https://developer.woocommerce.com/docs/category/extension-development/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Periksa dan modifikasi</a> aspek apa pun pada kode plugin inti.</li>\n<li>Kebut pengembangan dengan <a href=\"https://developer.woocommerce.com/docs/category/wc-cli/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">CLI</a> supercepat.</li>\n</ul>\n<p>Platform inti diuji secara ketat dengan frekuensi tinggi, serta didukung oleh tim pengembang khusus yang bekerja di berbagai zona waktu. Dokumentasi yang komprehensif diperbarui bersama dengan tiap peluncuran, sehingga dapat membantu Anda membangun toko sesuai keinginan.</p>\n<h4>Jadilah bagian dari komunitas internasional kami yang terus berkembang</h4>\n<p>WooCommerce memiliki komunitas yang besar dan peduli didedikasikan untuk membantu para penjual mencapai keberhasilan dan mengembangkan usaha dengan pesat.</p>\n<p>Ada banyak <a href=\"https://woocommerce.com/meetups/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Pertemuan WooCommerce</a> di berbagai kota di dunia yang bisa Anda ikuti secara gratis dan terlibat dalam pelaksanaannya. Acara ini adalah kesempatan berharga untuk belajar bersama, berbagi keahlian, dan bertemu dengan orang-orang yang memiliki minat serupa.</p>\n<p>WooCommerce juga rutin hadir di WordCamp di seluruh dunia – kami akan sangat senang bertemu dengan Anda.</p>\n<h4>Berkontribusi dan terjemahkan</h4>\n<p>WooCommerce dikembangkan dan didukung oleh Automattic, pencipta WordPress.com dan Jetpack. Kami juga memiliki ratusan kontributor independen, dan selalu ada ruang untuk lebih banyak lagi. Buka <a href=\"https://github.com/woocommerce/woocommerce?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Repositori GitHub WooCommerce</a> untuk mengetahui bagaimana anda dapat berkontribusi.</p>\n<p>WooCommerce diterjemahkan ke dalam beberapa bahasa, termasuk Denmark, Ukraina, dan Persia. Bantu melokalkan WooCommerce dengan menambahkan bahasa Anda – kunjungi <a href=\"https://translate.wordpress.org/projects/wp-plugins/woocommerce/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">translate.wordpress.org</a>.</p>\n<h4>Penyambungan ke WooCommerce.com</h4>\n<p>Anda dapat menyambungkan toko dengan <a href=\"https://woocommerce.com/\" rel=\"nofollow ugc\">WooCommerce.com</a> untuk mengelola langganan di Marketplace WooCommerce dan menerima pembaruan produk tanpa meninggalkan admin WordPress. Penyambungan tersebut juga memungkinkan instalasi produk yang dibeli langsung dari WooCommerce.com dan mempermudah akses dukungan teknis. Untuk informasi data yang dikumpulkan beserta penggunaannya, silakan baca <a href=\"https://automattic.com/privacy/\" rel=\"nofollow ugc\">Kebijakan Privasi</a> kami.</p>\n\";s:12:\"installation\";s:2532:\"<h4>Persyaratan Minimum</h4>\n<ul>\n<li>Diperlukan PHP versi 7.4 atau yang lebih baru (disarankan menggunakan PHP versi 8.0 atau yang lebih baru)</li>\n<li>Diperlukan MySQL versi 5.6 atau yang lebih baru ATAU MariaDB versi 10.1 atau yang lebih baru</li>\n</ul>\n<p>Lihat <a href=\"https://woocommerce.com/document/server-requirements/?utm_source=wp%20org%20repo%20listing&amp;utm_content=3.6\" rel=\"nofollow ugc\">dokumentasi persyaratan server WooCommerce</a> untuk detail daftar persyaratan server.</p>\n<h4>Instalasi otomatis</h4>\n<p>Penginstalan otomatis adalah pilihan termudah &#8212; WordPress akan menangani transfer file dan Anda tidak perlu meninggalkan peramban web. Untuk menginstal WooCommerce secara otomatis, login ke WordPress Dashboard Anda, arahkan ke menu Plugin, lalu klik &#8220;Tambah Baru&#8221;.</p>\n<p>Ketik “WooCommerce” di dalam kolom pencarian, lalu klik “Cari Plugin”. Setelah menemukan kami, Anda dapat melihat detailnya, seperti rilis poin, peringkat, dan deskripsi. Tentunya yang terpenting adalah Anda bisa menginstalnya! Klik “Instal Sekarang,” dan WordPress akan mengambil alih dari sana.</p>\n<h4>Instalasi manual</h4>\n<p>Metode instalasi manual memerlukan pengunduhan plugin WooCommerce dan mengunggahnya ke server web Anda melalui aplikasi FTP favorit Anda. Codex WordPress berisi <a href=\"https://wordpress.org/support/article/managing-plugins/#manual-plugin-installation\" rel=\"ugc\"> petunjuk tentang cara melakukannya di sini </a>.</p>\n<h4>Memperbarui</h4>\n<p>Pembaruan otomatis akan berjalan lancar, namun kami juga menyarankan agar Anda mencadangkan situs.</p>\n<p>Jika Anda mengalami masalah dengan halaman toko/kategori setelah pembaruan, bersihkan permalink dengan masuk ke WordPress &gt; Pengaturan &gt; Permalinks dan tekan &#8220;Simpan.&#8221; Itu seharusnya mengembalikan semuanya menjadi normal.</p>\n<h4>Contoh data</h4>\n<p>WooCommerce hadir dengan beberapa contoh data yang dapat Anda gunakan untuk melihat tampilan produk; impor sample_products.xml melalui <a href=\"https://wordpress.org/plugins/wordpress-importer/\" rel=\"ugc\">pengimpor WordPress.</a> Anda juga dapat menggunakan <a href=\"https://woocommerce.com/document/product-csv-importer-exporter/?utm_source=wp%20org%20repo%20listing&amp;utm_content=3.6\" rel=\"nofollow ugc\">pengimpor CSV</a> inti atau <a href=\"https://woocommerce.com/products/product-csv-import-suite/?utm_source=wp%20org%20repo%20listing&amp;utm_content=3.6\" rel=\"nofollow ugc\">ekstensi CSV Import Suite</a> kami untuk mengimpor sample_products.csv</p>\n\";s:3:\"faq\";s:8236:\"\n<dt id=\'where%20can%20i%20find%20woocommerce%20documentation%20and%20user%20guides%3F\'>\nDi mana saya bisa menemukan dokumentasi WooCommerce dan panduan pengguna?\n</h4>\n<p>\n<p>Untuk bantuan penyiapan dan konfigurasi WooCommerce, lihat <a href=\"https://woocommerce.com/documentation/plugins/woocommerce/getting-started/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Memulai</a> dan <a href=\"https://woocommerce.com/guides/new-store/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Panduan Pemilik Toko WooCommerce Baru</a>.</p>\n<p>Untuk memberi ekstensi atau tema pada WooCommerce, lihat <a href=\"https://github.com/woocommerce/woocommerce/tree/trunk/docs\" rel=\"nofollow ugc\">dokumentasi</a> kami, serta <a href=\"https://github.com/woocommerce/woocommerce/blob/trunk/docs/extension-development/extension-development-best-practices.md\" rel=\"nofollow ugc\">Buku Panduan Pengembang Plugin</a>.</p>\n</p>\n<dt id=\'where%20can%20i%20get%20help%20or%20talk%20to%20other%20users%20about%20woocommerce%20core%3F\'>\nDi mana saya bisa mendapatkan bantuan atau berdiskusi dengan pengguna lain tentang Inti WooCommerce?\n</h4>\n<p>\n<p>Saat mengalami kesulitan, Anda dapat meminta bantuan di <a href=\"https://wordpress.org/support/plugin/woocommerce/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"ugc\">Forum Dukungan WooCommerce</a> dengan mengikuti <a href=\"https://wordpress.org/support/topic/guide-to-the-woocommerce-forum/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"ugc\">pedoman ini</a>, bertanya di <a href=\"https://woocommerce.com/community-slack/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Slack Komunitas WooCommerce</a>, atau mengirim pos di <a href=\"https://www.facebook.com/groups/advanced.woocommerce?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">grup Komunitas WooCommerce</a> di Facebook.</p>\n</p>\n<dt id=\'where%20can%20i%20get%20help%20for%20extensions%20i%20have%20purchased%20from%20the%20woocommerce%20marketplace%3F\'>\nDi mana saya bisa mendapatkan bantuan terkait ekstensi yang saya beli dari Marketplace WooCommerce?\n</h4>\n<p>\n<p>Untuk bantuan untuk ekstensi berbayar dari Marketplace WooCommerce: pertama, lihat <a href=\"https://woocommerce.com/document/woocommerce-self-service-guide/\" rel=\"nofollow ugc\">panduan pemecahan masalah mandiri</a>. Jika masalah berlanjut, kirimkan tiket dukungan melalui <a href=\"https://woocommerce.com/my-account/create-a-ticket/\" rel=\"nofollow ugc\">layanan bantuan kami</a>. Tim Happiness Engineer akan memberikan respons dalam 24 jam.</p>\n</p>\n<dt id=\'i%E2%80%99m%20having%20trouble%20logging%20in%20to%20woocommerce.com%20%E2%80%93%20what%20now%3F\'>\nSaya mengalami masalah untuk login ke WooCommerce.com; apa yang harus saya lakukan?\n</h4>\n<p>\n<p>Pertama, pecahkan masalah login yang umum terjadi dengan <a href=\"https://woocommerce.com/document/log-into-woocommerce-com-with-wordpress-com/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">panduan langkah demi langkah</a> yang sangat membantu ini. Masih belum berhasil? <a href=\"https://woocommerce.com/contact-us/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Hubungi kami</a>.</p>\n</p>\n<dt id=\'will%20woocommerce%20work%20with%20my%20theme%3F\'>\nApakah WooCommerce dapat digunakan dengan tema saya?\n</h4>\n<p>\n<p>Ya! WooCommerce dapat digunakan dengan tema apa pun, tetapi mungkin memerlukan sedikit penataan. Jika Anda mencari tema dengan integrasi WooCommerce yang komprehensif, kami merekomendasikan <a href=\"https://woocommerce.com/storefront/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Storefront</a>.</p>\n</p>\n<dt id=\'how%20do%20i%20update%20woocommerce%3F\'>\nBagaimana cara memperbarui WooCommerce?\n</h4>\n<p>\n<p>Kami menyediakan panduan lengkap tentang <a href=\"https://woocommerce.com/document/how-to-update-woocommerce/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Cara Memperbarui WooCommerce</a>.</p>\n</p>\n<dt id=\'my%20site%20broke%20%E2%80%93%20what%20do%20i%20do%3F\'>\nSitus saya rusak – apa yang harus saya lakukan?\n</h4>\n<p>\n<p>Mulailah dengan mendiagnosis masalah melalui <a href=\"https://woocommerce.com/documentation/get-help/troubleshooting-get-help/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">panduan pemecahan masalah</a> yang siap membantu.</p>\n<p>Jika Anda melihat kesalahan setelah memperbarui tema atau plugin, mungkin ada masalah kompatibilitas antara hal tersebut dan WooCommerce. Jika masalah tersebut muncul setelah memperbarui WooCommerce, bisa jadi ada konflik antara WooCommerce dan tema atau plugin yang sudah usang.</p>\n<p>Dalam kedua kasus tersebut, kami menyarankan untuk menjalankan uji konflik dengan menggunakan <a href=\"https://woocommerce.com/document/troubleshooting-using-health-check/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Pemeriksaan Kesehatan</a> (sehingga Anda dapat menonaktifkan tema dan plugin tanpa memengaruhi pengalaman pengunjung) atau memecahkan masalah dengan menggunakan <a href=\"https://woocommerce.com/document/how-to-test-for-conflicts/#section-3?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">situs staging</a>.</p>\n</p>\n<dt id=\'where%20can%20i%20report%20bugs%3F\'>\nDi mana saya bisa melaporkan bug?\n</h4>\n<p>\n<p>Laporkan bug pada <a href=\"https://github.com/woocommerce/woocommerce/issues?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">repositori GitHub WooCommerce</a>. Anda juga dapat memberi tahu kami melalui forum dukungan kami &#8211; pastikan untuk mencari di forum untuk memastikan bahwa kesalahan tersebut belum dilaporkan sebelumnya.</p>\n</p>\n<dt id=\'where%20can%20i%20request%20new%20features%2C%20themes%2C%20and%20extensions%3F\'>\nDi mana saya bisa meminta fitur, tema, dan ekstensi baru?\n</h4>\n<p>\n<p>Ajukan permintaan fitur dan ekstensi baru, serta beri nilai untuk saran yang sudah ada di <a href=\"https://woocommerce.com/feature-requests/woocommerce?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">papan permintaan fitur</a> resmi kami. Tim Produk kami meninjau permintaan secara berkala dan mempertimbangkannya secara serius dalam perencanaan produk.</p>\n</p>\n<dt id=\'woocommerce%20is%20awesome%21%20can%20i%20contribute%3F\'>\nWooCommerce sangat mengagumkan! Dapatkah saya berkontribusi?\n</h4>\n<p>\n<p>Ya, Anda bisa! Bergabunglah dengan  <a href=\"https://github.com/woocommerce/woocommerce/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">repositori GitHub</a> dan ikuti <a href=\"https://woocommerce.wordpress.com/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">blog pengembangan</a> kami untuk memantau segala pembaruan dalam proyek ini.</p>\n</p>\n<dt id=\'where%20can%20i%20find%20rest%20api%20documentation%3F\'>\nDi mana saya bisa menemukan dokumentasi REST API?\n</h4>\n<p>\n<p>Beragam <a href=\"https://woocommerce.github.io/woocommerce-rest-api-docs/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Dokumentasi REST API WooCommerce</a> tersedia di GitHub.</p>\n</p>\n<dt id=\'my%20question%20is%20not%20listed%20here.%20where%20can%20i%20find%20more%20answers%3F\'>\nPertanyaan saya belum terdaftar di sini. Di mana saya bisa menemukan jawaban yang lebih lengkap?\n</h4>\n<p>\n<p>Lihat <a href=\"https://woocommerce.com/document/frequently-asked-questions/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing\" rel=\"nofollow ugc\">Pertanyaan Umum</a> untuk informasi selengkapnya.</p>\n</p>\n\n\";s:9:\"changelog\";s:605:\"<h4>9.8.1 2025-04-09</h4>\n<p><strong>WooCommerce</strong></p>\n<ul>\n<li>Fix &#8211; Fix a bug in which having 2x of a sold individually item in cart would throw a fatal. <a href=\"https://github.com/woocommerce/woocommerce/pull/57070\" rel=\"nofollow ugc\">#57070</a></li>\n<li>Dev &#8211; Fix flakiness in <code>product/product-edit.spec.js</code> <a href=\"https://github.com/woocommerce/woocommerce/pull/56900\" rel=\"nofollow ugc\">#56900</a></li>\n</ul>\n<p><a href=\"https://raw.githubusercontent.com/woocommerce/woocommerce/trunk/changelog.txt\" rel=\"nofollow ugc\">Lihat log perubahan untuk semua versi</a>.</p>\n\";s:11:\"screenshots\";s:1035:\"<ol><li><a href=\"https://ps.w.org/woocommerce/assets/screenshot-1.png?rev=3234504\"><img src=\"https://ps.w.org/woocommerce/assets/screenshot-1.png?rev=3234504\" alt=\"\"></a></li><li><a href=\"https://ps.w.org/woocommerce/assets/screenshot-2.png?rev=3234504\"><img src=\"https://ps.w.org/woocommerce/assets/screenshot-2.png?rev=3234504\" alt=\"\"></a></li><li><a href=\"https://ps.w.org/woocommerce/assets/screenshot-3.png?rev=3234504\"><img src=\"https://ps.w.org/woocommerce/assets/screenshot-3.png?rev=3234504\" alt=\"\"></a></li><li><a href=\"https://ps.w.org/woocommerce/assets/screenshot-4.png?rev=3235205\"><img src=\"https://ps.w.org/woocommerce/assets/screenshot-4.png?rev=3235205\" alt=\"\"></a></li><li><a href=\"https://ps.w.org/woocommerce/assets/screenshot-5.png?rev=3234504\"><img src=\"https://ps.w.org/woocommerce/assets/screenshot-5.png?rev=3234504\" alt=\"\"></a></li><li><a href=\"https://ps.w.org/woocommerce/assets/screenshot-6.png?rev=3234504\"><img src=\"https://ps.w.org/woocommerce/assets/screenshot-6.png?rev=3234504\" alt=\"\"></a></li></ol>\";s:7:\"reviews\";s:15412:\"<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Super easy</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 dari 5 bintang\" data-title-template=\"%s dari 5 bintang\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Oleh <a href=\"https://profiles.wordpress.org/jpsvensson/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/901005062d4b279257aa4a505f055a95462a8c18978fcd77d011e92311cf22be?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/901005062d4b279257aa4a505f055a95462a8c18978fcd77d011e92311cf22be?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/jpsvensson/\" class=\"reviewer-name\">jpsvensson</a> pada <span class=\"review-date\">April 11, 2025</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>WooCommerce works great and I got everything up and running within a copule of hours. I had some issues with the setup wizard but the support team helped me so I could get everything to work. </p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">amazing support</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 dari 5 bintang\" data-title-template=\"%s dari 5 bintang\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Oleh <a href=\"https://profiles.wordpress.org/maenmiu/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/9e73fc446484029510ae9255d6f47158d8362ef2b78d77d43772cd28dc80303f?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/9e73fc446484029510ae9255d6f47158d8362ef2b78d77d43772cd28dc80303f?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/maenmiu/\" class=\"reviewer-name\">Maria <small>(maenmiu)</small></a> pada <span class=\"review-date\">April 10, 2025</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>i didnt expect the support to be so damn good</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Best support</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 dari 5 bintang\" data-title-template=\"%s dari 5 bintang\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Oleh <a href=\"https://profiles.wordpress.org/govisola/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/0098294cb3219653ec310efdb88526db14b3e7be37edb3653983a0dfd910e7fd?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/0098294cb3219653ec310efdb88526db14b3e7be37edb3653983a0dfd910e7fd?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/govisola/\" class=\"reviewer-name\">Giuseppe <small>(govisola)</small></a> pada <span class=\"review-date\">April 9, 2025</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>As always, they are lightning-fast and super helpful. Thanks a bunch!</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">My first choice for webshops</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 dari 5 bintang\" data-title-template=\"%s dari 5 bintang\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Oleh <a href=\"https://profiles.wordpress.org/poomik/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/0a43669775a0c414be037d3207d7ce1615bd965b6bc44726bb7a35c789f0b4a6?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/0a43669775a0c414be037d3207d7ce1615bd965b6bc44726bb7a35c789f0b4a6?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/poomik/\" class=\"reviewer-name\">Michael Jensen <small>(poomik)</small></a> pada <span class=\"review-date\">April 9, 2025</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>For many years, woocommerce has been my choice for webshops, and it keeps getting better.<br />At the same time, fantastic support</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Shopfront not changing shipping charges</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 dari 5 bintang\" data-title-template=\"%s dari 5 bintang\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Oleh <a href=\"https://profiles.wordpress.org/esotericbookshop/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/5c95a2c90a06274d32c7047ece1d98e7bc116c8ee84c034147d74aba339e846b?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/5c95a2c90a06274d32c7047ece1d98e7bc116c8ee84c034147d74aba339e846b?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/esotericbookshop/\" class=\"reviewer-name\">esotericbookshop</a> pada <span class=\"review-date\">April 4, 2025</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>It was such an easy fix, although, if I may say, not an intuitive answer (I\'m not a techo - so I see things differently).  However, support was great!  Extremely helpful and stuck with me until he (she?) had worked out what I was doing wrong.  Very, very happy.</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Great Support</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 dari 5 bintang\" data-title-template=\"%s dari 5 bintang\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Oleh <a href=\"https://profiles.wordpress.org/keyurgajera/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/aa779698f3eed4f3f91c5cda45e8c90c19242f262143b72758983c72b90bd524?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/aa779698f3eed4f3f91c5cda45e8c90c19242f262143b72758983c72b90bd524?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/keyurgajera/\" class=\"reviewer-name\">ramjipatel <small>(keyurgajera)</small></a> pada <span class=\"review-date\">April 2, 2025</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>Thanks team for great support, help in issue troubleshooting and clear and friendly communication!</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Great Support</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 dari 5 bintang\" data-title-template=\"%s dari 5 bintang\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Oleh <a href=\"https://profiles.wordpress.org/eligore/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/397759d4232847514e837da51fd6000651b797ad0933d5912828607e408eb67b?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/397759d4232847514e837da51fd6000651b797ad0933d5912828607e408eb67b?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/eligore/\" class=\"reviewer-name\">eligore</a> pada <span class=\"review-date\">Maret 31, 2025</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>Thanks team for great support, help in issue troubleshooting and clear and friendly communication!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Best for WooCommerce</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 dari 5 bintang\" data-title-template=\"%s dari 5 bintang\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Oleh <a href=\"https://profiles.wordpress.org/quotesninja/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/b070c217a3aefab7b6e6d20c0731674f7931ccf3c3d9605ae755450f4d254a69?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/b070c217a3aefab7b6e6d20c0731674f7931ccf3c3d9605ae755450f4d254a69?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/quotesninja/\" class=\"reviewer-name\">Quotes Ninja <small>(quotesninja)</small></a> pada <span class=\"review-date\">Maret 27, 2025</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>Google WooCommerce plug-in helped me to integrate my store with Google services which helped me to boost visibility also helped for tracking performance and simplifying advertising.</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Great Support</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 dari 5 bintang\" data-title-template=\"%s dari 5 bintang\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Oleh <a href=\"https://profiles.wordpress.org/cyberrick/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/9837cd3fcf6d945971b3aa28b92a8efd5787ed767a5e51445a691a84a5268de9?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/9837cd3fcf6d945971b3aa28b92a8efd5787ed767a5e51445a691a84a5268de9?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/cyberrick/\" class=\"reviewer-name\">cyberrick</a> pada <span class=\"review-date\">Maret 27, 2025</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>Works very well but had a couple of issues with the cache needing to be cleared first and make sure the browser will accept cookies before configuring.  The support was top notch!</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Support was excellent</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 dari 5 bintang\" data-title-template=\"%s dari 5 bintang\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Oleh <a href=\"https://profiles.wordpress.org/omardesko/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/8d8512a94b123b2a71f0a4b05eca505ad7aa53c9b584d4a6351c92d215d006e7?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/8d8512a94b123b2a71f0a4b05eca505ad7aa53c9b584d4a6351c92d215d006e7?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/omardesko/\" class=\"reviewer-name\">omardesko</a> pada <span class=\"review-date\">Maret 26, 2025</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>Hi, I receive a good support to fix a problem i had with a plug-in admin variations.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Thanks</p>\n<!-- /wp:paragraph --></div>\n</div>\n\";}s:17:\"short_description\";s:190:\"Semua yang Anda butuhkan untuk meluncurkan toko online dalam beberapa hari dan menjaganya tumbuh selama bertahun-tahun. Dari penjualan pertama hingga jutaan pendapatan, Woo ada bersama Anda.\";s:13:\"download_link\";s:60:\"https://downloads.wordpress.org/plugin/woocommerce.9.8.1.zip\";s:14:\"upgrade_notice\";a:0:{}s:11:\"screenshots\";a:6:{i:1;a:2:{s:3:\"src\";s:64:\"https://ps.w.org/woocommerce/assets/screenshot-1.png?rev=3234504\";s:7:\"caption\";s:0:\"\";}i:2;a:2:{s:3:\"src\";s:64:\"