ck-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:columns {\"align\":\"wide\",\"style\":{\"spacing\":{\"blockGap\":{\"top\":\"var:preset|spacing|40\",\"left\":\"var:preset|spacing|30\"}}}} -->\n<div class=\"wp-block-columns alignwide\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading {\"level\":3,\"style\":{\"typography\":{\"fontStyle\":\"normal\",\"fontWeight\":\"700\"}},\"fontSize\":\"medium\"} -->\n<h3 class=\"wp-block-heading has-medium-font-size\" style=\"font-style:normal;font-weight:700\">Kustomisasi furnitur</h3>\n<!-- /wp:heading -->\n\n<!-- wp:group {\"style\":{\"spacing\":{\"padding\":{\"bottom\":\"4px\"}}},\"layout\":{\"type\":\"constrained\"}} -->\n<div class=\"wp-block-group\" style=\"padding-bottom:4px\"><!-- wp:image {\"id\":63,\"aspectRatio\":\"3/2\",\"scale\":\"cover\",\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://wooblockpatterns.wpcomstaging.com/wp-content/uploads/2024/06/table-wood-house-chair-floor-window-1-1024x683.jpg\" alt=\"\" class=\"wp-image-63\" style=\"aspect-ratio:3/2;object-fit:cover\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:group -->\n\n<!-- wp:paragraph -->\n<p>Buatlah karya khusus yang pas banget dengan ruang dan gaya kamu dengan layanan kustomisasi kami. Dari pemilihan kain hingga dimensi, kami akan mewujudkan visi kamu.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"#\">Mulai sekarang</a></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading {\"level\":3,\"style\":{\"typography\":{\"fontStyle\":\"normal\",\"fontWeight\":\"700\"}},\"fontSize\":\"medium\"} -->\n<h3 class=\"wp-block-heading has-medium-font-size\" style=\"font-style:normal;font-weight:700\">Desain interior</h3>\n<!-- /wp:heading -->\n\n<!-- wp:group {\"style\":{\"spacing\":{\"padding\":{\"bottom\":\"4px\"}}},\"layout\":{\"type\":\"constrained\"}} -->\n<div class=\"wp-block-group\" style=\"padding-bottom:4px\"><!-- wp:image {\"id\":304,\"aspectRatio\":\"3/2\",\"scale\":\"cover\",\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://wooblockpatterns.wpcomstaging.com/wp-content/uploads/2024/07/54f708281f82831c082a1cf9d7b7faa9-1-683x1024.jpeg\" alt=\"\" class=\"wp-image-304\" style=\"aspect-ratio:3/2;object-fit:cover\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:group -->\n\n<!-- wp:paragraph -->\n<p>Desainer ahli kami akan bekerja sama dengan Anda untuk mengubah ruang Anda menjadi tempat yang bergaya dan fungsional yang mencerminkan selera dan gaya hidup pribadi Anda.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"#\">Mulai sekarang</a></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading {\"level\":3,\"style\":{\"typography\":{\"fontStyle\":\"normal\",\"fontWeight\":\"700\"}},\"fontSize\":\"medium\"} -->\n<h3 class=\"wp-block-heading has-medium-font-size\" style=\"font-style:normal;font-weight:700\">Pengiriman dan perakitan</h3>\n<!-- /wp:heading -->\n\n<!-- wp:group {\"style\":{\"spacing\":{\"padding\":{\"bottom\":\"4px\"}}},\"layout\":{\"type\":\"constrained\"}} -->\n<div class=\"wp-block-group\" style=\"padding-bottom:4px\"><!-- wp:image {\"id\":354,\"aspectRatio\":\"3/2\",\"scale\":\"cover\",\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://wooblockpatterns.wpcomstaging.com/wp-content/uploads/2024/07/ade23ce2024ccbbb42f7f7d6dfe5f2e0-1-684x1024.jpeg\" alt=\"\" class=\"wp-image-354\" style=\"aspect-ratio:3/2;object-fit:cover\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:group -->\n\n<!-- wp:paragraph -->\n<p>Nikmati belanja tanpa repot dengan layanan pengiriman dan perakitan kami. Biarkan tim kami menangani angkat berat dan instalasi, supaya kamu bisa bersantai di rumah yang baru saja kamu furnitur.</p>\n<!-