:heading {\"fontSize\":\"x-large\"} -->\n<h2 class=\"wp-block-heading has-x-large-font-size\">Berkomitmen untuk gaya hidup yang lebih ramah lingkungan</h2>\n<!-- /wp:heading --></div>\n<!-- /wp:group -->\n\n<!-- wp:group {\"layout\":{\"type\":\"constrained\",\"contentSize\":\"400px\"}} -->\n<div class=\"wp-block-group\"><!-- wp:paragraph -->\n<p>Passion kami adalah menciptakan momen yang penuh perhatian dengan produk yang bersumber secara lokal, organik, dan berkelanjutan. Kami lebih dari sekadar toko; kami adalah jalanmu menuju gaya hidup yang ramah lingkungan dan didorong oleh komunitas yang mengedepankan kualitas premium.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:buttons -->\n<div class=\"wp-block-buttons\"><!-- wp:button --><div class=\"wp-block-button\"><a class=\"wp-block-button__link wp-element-button\">Temui kami</a></div><!-- /wp:button --></div>\n<!-- /wp:buttons --></div>\n<!-- /wp:group --></div>\n<!-- /wp:group --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer {\"height\":\"calc( 0.25 * var(\\u002d\\u002dwp\\u002d\\u002dstyle\\u002d\\u002droot\\u002d\\u002dpadding-right, var(\\u002d\\u002dwp\\u002d\\u002dcustom\\u002d\\u002dgap\\u002d\\u002dhorizontal)))\"} -->\n<div style=\"height:calc( 0.25 * var(--wp--style--root--padding-right, var(--wp--custom--gap--horizontal)))\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer --></div>\n<!-- /wp:group -->\";s:14:\"disallow_after\";a:0:{}s:12:\"dependencies\";a:0:{}s:10:\"categories\";a:1:{s:22:\"_dotcom_imported_about\";a:3:{s:4:\"slug\";s:22:\"_dotcom_imported_about\";s:5:\"title\";s:22:\"_dotcom_imported_about\";s:11:\"description\";s:0:\"\";}}s:24:\"virtual_theme_categories\";a:0:{}s:4:\"tags\";a:0:{}s:12:\"pattern_meta\";a:0:{}s:10:\"source_url\";s:82:\"https://wooblockpatterns.wpcomstaging.com/2024/07/01/tall-content-with-image-left/\";s:13:\"modified_date\";s:19:\"2024-07-04 14:06:24\";s:12:\"preview_data\";a:0:{}s:9:\"post_type\";s:8:\"wp_block\";s:22:\"is_in