r(--wp--custom--gap--horizontal)));padding-right:var(--wp--style--root--padding-right, var(--wp--custom--gap--horizontal));padding-bottom:calc( 0.5 * var(--wp--style--root--padding-right, var(--wp--custom--gap--horizontal)));padding-left:var(--wp--style--root--padding-left, var(--wp--custom--gap--horizontal))\"><!-- wp:spacer {\"height\":\"calc( 0.25 * var(\\u002d\\u002dwp\\u002d\\u002dstyle\\u002d\\u002droot\\u002d\\u002dpadding-right, var(\\u002d\\u002dwp\\u002d\\u002dcustom\\u002d\\u002dgap\\u002d\\u002dhorizontal)))\"} -->\n<div style=\"height:calc( 0.25 * var(--wp--style--root--padding-right, var(--wp--custom--gap--horizontal)))\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:columns {\"align\":\"wide\"} -->\n<div class=\"wp-block-columns alignwide\"><!-- wp:column {\"width\":\"40%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:40%\"></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":\"\"} -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>Kami berdedikasi untuk menciptakan karya-karya abadi yang tahan uji waktu. Setiap pakaian dan aksesori dalam koleksi kami adalah bukti komitmen kami yang tak tergoyahkan terhadap kualitas dan kerajinan. Kami bangga hanya menggunakan bahan-bahan terbaik dan menerapkan perhatian yang teliti terhadap detail di setiap langkah proses penciptaan. Dari jahitan hingga sentuhan akhir, produk kami dirancang dengan cermat untuk memancarkan daya tahan, umur panjang, dan keanggunan yang abadi. Ketika kamu berbelanja dengan kami, kamu bisa percaya bahwa kamu berinvestasi dalam barang-barang yang tidak hanya bergaya tetapi juga dibuat untuk bertahan, memastikan bertahun-tahun kesenangan dan pemakaian. Kami percaya pada mode yang tidak hanya terlihat baik tetapi juga memberikan manfaat bagi planet dan masyarakatnya. Itulah sebabnya kami berkomitmen untuk mengurangi dampak lingkungan dan sosial dari industri pakaian dan aksesori. Ketika kamu berbelanja dengan kami, kamu bisa merasa yakin bahwa pembelianmu mendukung pendekatan yang lebih berkelanjutan dan etis terhadap mode, membuat perbedaan positif di dunia.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer {\"height\":\"calc( 0.25 * var(\\u002d\\u002dwp\\u002d\\u002dstyle\\u002d\\u002droot\\u002d\\u002dpadding-right, var(\\u002d\\u002dwp\\u002d\\u002dcustom\\u002d\\u002dgap\\u002d\\u002dhorizontal)))\"} -->\n<div style=\"height:calc( 0.25 * var(--wp--style--root--padding-right, var(--wp--custom--gap--horizontal)))\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer --></div>\n<!-- /wp:group -->\";s:14:\"disallow_after\";a:0:{}s:12:\"dependencies\";a:0:{}s:10:\"categories\";a:1:{s:22:\"_dotcom_imported_about\";a:3:{s:4:\"slug\";s:22:\"_dotcom_imported_about\";s:5:\"title\";s:22:\"_dotcom_imported_about\";s:11:\"description\";s:0:\"\";}}s:24:\"virtual_theme_categories\";a:0:{}s:4:\"tags\";a:0:{}s:12:\"pattern_meta\";a:0:{}s:10:\"source_url\";s:75:\"https://wooblockpatterns.wpcomstaging.com/2024/07/01/right-aligned-content/\";s:13:\"modified_date\";s:19:\"2024-07-01 16:23:24\";s:12:\"preview_data\";a:0:{}s:9:\"post_type\";s:8:\"wp_block\";s:22:\"is_included_in_big_sky\";i:0;}i:31;a:18:{s:2:\"ID\";i:306;s:7:\"site_id\";i:231214916;s:5:\"title\";s:42:\"Judul besar dengan konten di sebelah kanan\";s:4:\"name\";s:39:\"large-heading-with-content-on-the-right\";s:11:\"description\";s:0:\"\";s:14:\"ai_description\";s:0:\"\";s:4:\"html\";s:3424:\"<!-- wp:group {\"metadata\":{\"name\":\"About\"},\"align\":\"full\",\"style\":{\"spacing\":{\"padding\":{\"top\":\"calc( 0.5 * var(\\u002d\\u002dwp\\u002d\\u002dstyle\\u002d\\u002droot\\u002d\\u002dpadding-right, var(\\u002d\\u002dwp\\u002d\\u002dcustom\\u002d\\u002dgap\\u002d\\u002dhorizontal)))\",\"bottom\":\"calc( 0.5 * var(\\u002d\\u002dwp\\u002d\\u002dstyle\\u002d\\u002droot\\u002d\\u002dpadding-right, var(\\u002d\\u002dwp\\u002d\\u002dcustom\\u002d\\u002dgap\\u002d\\u002dhoriz