-basis:50%\"><!-- wp:paragraph -->\n<p>Selamat datang di dunia kemungkinan tanpa batas, di mana perjalanan sama serunya dengan tujuan, dan di mana setiap momen adalah kesempatan untuk meninggalkan jejak di kanvas kehidupan. Satu-satunya batas adalah sejauh imajinasi Anda.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:buttons -->\n<div class=\"wp-block-buttons\"><!-- wp:button --><div class=\"wp-block-button\"><a class=\"wp-block-button__link wp-element-button\">Mulai</a></div><!-- /wp:button --></div>\n<!-- /wp:buttons --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer {\"height\":\"calc( 0.25 * var(\\u002d\\u002dwp\\u002d\\u002dstyle\\u002d\\u002droot\\u002d\\u002dpadding-right, var(\\u002d\\u002dwp\\u002d\\u002dcustom\\u002d\\u002dgap\\u002d\\u002dhorizontal)))\"} -->\n<div style=\"height:calc( 0.25 * var(--wp--style--root--padding-right, var(--wp--custom--gap--horizontal)))\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:spacer {\"height\":\"var:preset|spacing|10\"} -->\n<div style=\"height:var(--wp--preset--spacing--10)\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer --></div>\n<!-- /wp:group -->\";s:14:\"disallow_after\";a:0:{}s:12:\"dependencies\";a:0:{}s:10:\"categories\";a:1:{s:22:\"_dotcom_imported_about\";a:3:{s:4:\"slug\";s:22:\"_dotcom_imported_about\";s:5:\"title\";s:22:\"_dotcom_imported_about\";s:11:\"description\";s:0:\"\";}}s:24:\"virtual_theme_categories\";a:0:{}s:4:\"tags\";a:0:{}s:12:\"pattern_meta\";a:0:{}s:10:\"source_url\";s:93:\"https://wooblockpatterns.wpcomstaging.com/2024/07/01/large-heading-with-content-on-the-right/\";s:13:\"modified_date\";s:19:\"2024-07-01 16:22:38\";s:12:\"preview_data\";a:0:{}s:9:\"post_type\";s:8:\"wp_block\";s:22:\"is_included_in_big_sky\";i:0;}i:32;a:18:{s:2:\"ID\";i:303;s:7:\"site_id\";i:231214916;s:5:\"title\";s:44:\"Konten tinggi dengan gambar di sebelah kanan\";s:4:\"name\";s:29:\"tall-content-with-image-right\";s:11:\"descript