- wp:paragraph -->\n<p>Selamat datang di tujuan utama Anda untuk headphone Premium dan aksesori audio. Selami koleksi kami yang telah dipilih, di mana teknologi mutakhir bertemu dengan desain yang ramping untuk memberikan pengalaman mendengarkan yang tak tertandingi. Dari keajaiban nirkabel hingga keajaiban peredam bising, kami punya pasangan yang sempurna untuk setiap gaya hidup dan preferensi.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer {\"height\":\"var:preset|spacing|10\"} -->\n<div style=\"height:var(--wp--preset--spacing--10)\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer --></div>\n<!-- /wp:group -->\";s:14:\"disallow_after\";a:0:{}s:12:\"dependencies\";a:0:{}s:10:\"categories\";a:1:{s:22:\"_dotcom_imported_about\";a:3:{s:4:\"slug\";s:22:\"_dotcom_imported_about\";s:5:\"title\";s:22:\"_dotcom_imported_about\";s:11:\"description\";s:0:\"\";}}s:24:\"virtual_theme_categories\";a:0:{}s:4:\"tags\";a:0:{}s:12:\"pattern_meta\";a:0:{}s:10:\"source_url\";s:88:\"https://wooblockpatterns.wpcomstaging.com/2024/07/01/fullwidth-image-content-pull-right/\";s:13:\"modified_date\";s:19:\"2024-07-01 15:53:49\";s:12:\"preview_data\";a:0:{}s:9:\"post_type\";s:8:\"wp_block\";s:22:\"is_included_in_big_sky\";i:0;}i:37;a:18:{s:2:\"ID\";i:291;s:7:\"site_id\";i:231214916;s:5:\"title\";s:25:\"Konten kiri, gambar kanan\";s:4:\"name\";s:24:\"content-left-image-right\";s:11:\"description\";s:0:\"\";s:14:\"ai_description\";s:0:\"\";s:4:\"html\";s:3480:\"<!-- wp:group {\"metadata\":{\"name\":\"About\"},\"align\":\"full\",\"style\":{\"spacing\":{\"padding\":{\"top\":\"calc( 0.5 * var(\\u002d\\u002dwp\\u002d\\u002dstyle\\u002d\\u002droot\\u002d\\u002dpadding-right, var(\\u002d\\u002dwp\\u002d\\u002dcustom\\u002d\\u002dgap\\u002d\\u002dhorizontal)))\",\"bottom\":\"calc( 0.5 * var(\\u002d\\u002dwp\\u002d\\u002dstyle\\u002d\\u002droot\\u002d\\u002dpadding-right, var(\\u002d\\u002dwp\\u002d\\u002dcustom\\u002d\\u00