agraph -->\n<p>Di jantung misi kami adalah komitmen terhadap keberlanjutan. Kami memprioritaskan praktik ramah lingkungan dengan mengutamakan produk yang ditanam secara lokal, meminimalkan limbah kemasan, dan mendukung metode pertanian yang berkelanjutan.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:group {\"style\":{\"spacing\":{\"margin\":{\"bottom\":\"10px\"}}},\"layout\":{\"type\":\"default\"}} -->\n<div class=\"wp-block-group\" style=\"margin-bottom:10px\"><!-- wp:image {\"id\":273,\"aspectRatio\":\"4/3\",\"scale\":\"cover\",\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"style\":{\"color\":[]}} -->\n<figure class=\"wp-block-image size-full\"><img src=\"https://wooblockpatterns.wpcomstaging.com/wp-content/uploads/2024/07/44024b9b9c88dd50f5cf11f5c31311c5-1.jpeg\" alt=\"\" class=\"wp-image-273\" style=\"aspect-ratio:4/3;object-fit:cover\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:group -->\n\n<!-- wp:heading {\"level\":3,\"fontSize\":\"large\"} -->\n<h3 class=\"wp-block-heading has-large-font-size\">Kualitas dan kesegaran</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Setiap langkah dari proses kami, mulai dari pemilihan bahan yang teliti hingga mematuhi standar yang ketat, mencerminkan dedikasi kami terhadap kualitas. Dari panen awal hingga produk jadi, kami mempertahankan standar kesegaran dan rasa yang tak tergoyahkan.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer {\"height\":\"calc( 0.25 * var(\\u002d\\u002dwp\\u002d\\u002dstyle\\u002d\\u002droot\\u002d\\u002dpadding-right, var(\\u002d\\u002dwp\\u002d\\u002dcustom\\u002d\\u002dgap\\u002d\\u002dhorizontal)))\"} -->\n<div style=\"height:calc( 0.25 * var(--wp--style--root--padding-right, var(--wp--custom--gap--horizontal)))\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer --></div>\n<!-- /wp:group -->\";s:14:\"disallow_after\";a:0:{}s:12:\"depen