-image size-full is-style-default\"><img src=\"https://wooblockpatterns.wpcomstaging.com/wp-content/uploads/2024/06/plant-white-leaf-flower-vase-green.jpg\" alt=\"\" class=\"wp-image-62\" style=\"aspect-ratio:1;object-fit:cover\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":69,\"aspectRatio\":\"1\",\"scale\":\"cover\",\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"className\":\"is-style-default\"} -->\n<figure class=\"wp-block-image size-full is-style-default\"><img src=\"https://wooblockpatterns.wpcomstaging.com/wp-content/uploads/2024/06/tree-branch-plant-wood-leaf-flower.jpg\" alt=\"\" class=\"wp-image-69\" style=\"aspect-ratio:1;object-fit:cover\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"verticalAlignment\":\"center\",\"width\":\"40%\",\"layout\":{\"type\":\"constrained\",\"justifyContent\":\"left\",\"contentSize\":\"400px\"}} -->\n<div class=\"wp-block-column is-vertically-aligned-center\" style=\"flex-basis:40%\"><!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Menciptakan keindahan</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Kami berkomitmen pada seni kerajinan, di mana setiap vas dibuat dengan teliti hingga sempurna. Gairah kami untuk detail dan komitmen terhadap kualitas terlihat jelas di setiap karya, menghasilkan vas yang bukan hanya fungsional, tetapi juga karya seni yang sejati.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:buttons -->\n<div class=\"wp-block-buttons\"><!-- wp:button --><div class=\"wp-block-button\"><a class=\"wp-block-button__link wp-element-button\">Lebih banyak tentang kami</a></div><!-- /wp:button --></div>\n<!-- /wp:buttons --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer {\"height\":\"calc( 0.25 * var(\\u002d\\u002dwp\\u002d\\u002dstyle\\u002d\\u002droot\\u002d\\u002dpadding-right, var(\\u002d\\u002dwp\\u002d\\u002dcustom\\u002d\\u002dgap\\u002d\\u002dhorizontal)))\"} -->\n<div style=\"h