" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:columns {\"align\":\"wide\"} -->\n<div class=\"wp-block-columns alignwide\"><!-- wp:column {\"width\":\"15%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:15%\"></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":\"70%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:70%\"><!-- wp:heading {\"textAlign\":\"center\",\"fontSize\":\"xx-large\"} -->\n<h2 class=\"wp-block-heading has-text-align-center has-xx-large-font-size\">Selamat datang di rumah</h2>\n<!-- /wp:heading -->\n\n<!-- wp:buttons {\"layout\":{\"type\":\"flex\",\"justifyContent\":\"center\"}} -->\n<div class=\"wp-block-buttons\"><!-- wp:button {\"textAlign\":\"center\"} --><div class=\"wp-block-button\"><a class=\"wp-block-button__link has-text-align-center wp-element-button\">Mulai</a></div><!-- /wp:button --></div>\n<!-- /wp:buttons --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":\"15%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:15%\"></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer {\"height\":\"calc( 0.25 * var(\\u002d\\u002dwp\\u002d\\u002dstyle\\u002d\\u002droot\\u002d\\u002dpadding-right, var(\\u002d\\u002dwp\\u002d\\u002dcustom\\u002d\\u002dgap\\u002d\\u002dhorizontal)))\"} -->\n<div style=\"height:calc( 0.25 * var(--wp--style--root--padding-right, var(--wp--custom--gap--horizontal)))\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>Kami percaya bahwa rumahmu harus mencerminkan gaya dan kepribadian unikmu. Koleksi barang-barang penting dan dekorasi rumah yang kami pilih dirancang untuk membantumu menciptakan ruang yang benar-benar Suka kamu. Dari furnitur yang nyaman hingga aksen yang stylish, kami menawarkan segala yang kamu butuhkan untuk mengubah rumahmu menjadi rumah.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>Desainer ahli kami akan bekerja sama dengan Anda untuk mewujudkan visi Anda. Dari pemilihan furnitur hingga skema warna, kami akan memberikan saran dan panduan profesional di setiap langkah untuk membantu Anda mencapai keseimbangan sempurna antara kenyamanan, fungsionalitas, dan daya tarik estetika.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer {\"height\":\"calc( 0.25 * var(\\u002d\\u002dwp\\u002d\\u002dstyle\\u002d\\u002droot\\u002d\\u002dpadding-right, var(\\u002d\\u002dwp\\u002d\\u002dcustom\\u002d\\u002dgap\\u002d\\u002dhorizontal)))\"} -->\n<div style=\"height:calc( 0.25 * var(--wp--style--root--padding-right, var(--wp--custom--gap--horizontal)))\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer --></div>\n<!-- /wp:group -->\";s:14:\"disallow_after\";a:0:{}s:12:\"dependencies\";a:0:{}s:10:\"categories\";a:1:{s:22:\"_dotcom_imported_intro\";a:3:{s:4:\"slug\";s:22:\"_dotcom_imported_intro\";s:5:\"title\";s:22:\"_dotcom_imported_intro\";s:11:\"description\";s:0:\"\";}}s:24:\"virtual_theme_categories\";a:0:{}s:4:\"tags\";a:0:{}s:12:\"pattern_meta\";a:0:{}s:10:\"source_url\";s:91:\"https://wooblockpatterns.wpcomstaging.com/2024/07/01/centered-heading-with-two-column-text/\";s:13:\"modified_date\";s:19:\"2024-07-01 15:08:38\";s:12:\"preview_data\";a:0:{}s:9:\"post_type\";s:8:\"wp_block\";s:22:\"is_included_in_big_sky\";i:0;}i:54;a:18:{s:2:\"ID\";i:243;s:7:\"site_id\";i:231214916;s:5:\"title\";s:34:\"Dua kolom dengan gambar dan konten\";s:4:\"name\";s:35:\"two-column-with-image-and-content-2\";s:11:\"description\";s:0:\"\";s:14:\"ai_description\";s:0:\"\";s:4:\"html\";s:3547:\"<!-- wp:group {\"metadata\":{\"name\":\"Intro\"},\"align\":\"full\",\"style\":{\"spacing\":{\"padding\":{\"top\":\"calc( 0.5 * var(\\u002d\\u002dwp\\u002d\\u002dstyle\\u002d\\u002droot\\u002d\\