ext-align-center\">Baru di toko</h2>\n<!-- /wp:heading -->\n\n<!-- wp:woocommerce/product-new {\"columns\":4,\"rows\":1} /--></div>\n<!-- /wp:woocommerce/empty-cart-block --></div>\n<!-- /wp:woocommerce/cart -->','Keranjang','','publish','closed','closed','','cart','','','2025-04-14 04:20:57','2025-04-14 04:20:57','',0,'http://style.local/cart/',0,'page','',0);
