INSERT INTO `wp_posts` VALUES (63,1,'2025-04-12 10:40:08','2025-04-12 10:40:08','<p class=\"\" data-start=\"40\" data-end=\"121\"><span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\"><strong data-start=\"39\" data-end=\"90\">Tommy Hilfiger Stewart Black Dial Leather Strap</strong> (model TH-1710605), jam tangan pria dengan desain elegan dan multifungsi.</span></p>\r\n\r\n\r\n<hr class=\"\" data-start=\"123\" data-end=\"126\" />\r\n\r\n<h3 class=\"\" data-start=\"128\" data-end=\"157\">🕰️ <strong data-start=\"136\" data-end=\"157\">Spesifikasi Utama</strong></h3>\r\n<ul data-start=\"158\" data-end=\"1085\">\r\n 	<li class=\"\" data-start=\"158\" data-end=\"252\">\r\n<p class=\"\" data-start=\"160\" data-end=\"252\"><strong data-start=\"160\" data-end=\"169\">Model</strong>: <span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Tommy Hilfiger Stewart TH-1710605</span>​</p>\r\n</li>\r\n 	<li class=\"\" data-start=\"253\" data-end=\"357\">\r\n<p class=\"\" data-start=\"255\" data-end=\"357\"><strong data-start=\"255\" data-end=\"274\">Diameter Casing</strong>: <span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">44 mm</span>​</p>\r\n</li>\r\n 	<li class=\"\" data-start=\"358\" data-end=\"459\">\r\n<p class=\"\" data-start=\"360\" data-end=\"459\"><strong data-start=\"360\" data-end=\"376\">Bahan Casing</strong>: <span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Stainless steel</span>​</p>\r\n</li>\r\n 	<li class=\"\" data-start=\"460\" data-end=\"561\">\r\n<p class=\"\" data-start=\"462\" data-end=\"561\"><strong data-start=\"462\" data-end=\"476\">Warna Dial</strong>: <span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Hitam</span>​</p>\r\n</li>\r\n 	<li class=\"\" data-start=\"562\" data-end=\"665\">\r\n<p class=\"\" data-start=\"564\" data-end=\"665\"><strong data-start=\"564\" data-end=\"578\">Bahan Tali</strong>: <span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Kulit asli berwarna hitam</span>​</p>\r\n</li>\r\n 	<li class=\"\" data-start=\"666\" data-end=\"772\">\r\n<p class=\"\" data-start=\"668\" data-end=\"772\"><strong data-start=\"668\" data-end=\"685\">Jenis Gerakan</strong>: <span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Quartz multifungsi</span></p>\r\n</li>\r\n 	<li class=\"\" data-start=\"773\" data-end=\"870\">\r\n<p class=\"\" data-start=\"775\" data-end=\"870\"><strong data-start=\"775\" data-end=\"783\">Kaca</strong>: <span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Mineral glass</span>​</p>\r\n</li>\r\n 	<li class=\"\" data-start=\"871\" data-end=\"977\">\r\n<p class=\"\" data-start=\"873\" data-end=\"977\"><strong data-start=\"873\" data-end=\"890\">Ketahanan Air</strong>: <span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">5 ATM</span>​</p>\r\n</li>\r\n 	<li class=\"\" data-start=\"978\" data-end=\"1085\">\r\n<p class=\"\" data-start=\"980\" data-end=\"1085\"><strong data-start=\"980\" data-end=\"998\">Fitur Tambahan</strong>: <span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Tampilan hari dan tanggal, format waktu 12/24 jam</span>​</p>\r\n</li>\r\n</ul>\r\n\r\n<hr class=\"\" data-start=\"1087\" data-end=\"1090\" />\r\n\r\n<h3 class=\"\" data-start=\"1092\" data-end=\"1111\">🎯 <strong data-start=\"1099\" data-end=\"1111\">Kegunaan</strong></h3>\r\n<p class=\"\" data-start=\"1112\" data-end=\"1277\"><span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Jam tangan ini cocok untuk berbagai kesempatan, baik formal maupun kasual.</span> <span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Desainnya yang elegan dengan dial hitam dan tali kulit memberikan kesan maskulin dan profesional.</span> <span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Fitur multifungsi seperti tampilan hari dan tanggal serta format waktu 12/24 jam menambah kepraktisan dalam penggunaan sehari-hari.</span></p>','Tommy Hilfiger Stewart Black Dial Leather Strap','<span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Tommy Hilfiger Stewart TH-1710605, jam tangan pria dengan desain elegan dan multifungsi.</span>','publish','open','closed','','tommy-hilfiger-stewart-black-dial-leather-strap','','','2025-04-14 04:40:57','2025-04-14 04:40:57','',0,'http://style.local/?post_type=product&#038;p=63',0,'product','',0);
