INSERT INTO `wp_posts` VALUES (230,4,'2025-04-14 06:16:57','2025-04-14 06:16:57','<p class=\"\" data-start=\"155\" data-end=\"312\"><span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Tas ini memiliki desain yang mencolok dengan motif logo \"STEVE MADDEN\" berukuran besar yang tercetak di seluruh permukaan tas.</span> <span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Warna dasar hitam memberikan kesan elegan dan mudah dipadukan dengan berbagai outfit, sementara cetakan logo putih memberikan sentuhan modern dan berani.</span> <span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Tali rantai ganda berwarna perak menambahkan nuansa edgy dan mewah pada tas ini.</span>​</p>\r\n\r\n<h3 class=\"\" data-start=\"314\" data-end=\"332\">📐 Spesifikasi</h3>\r\n<ul data-start=\"333\" data-end=\"921\">\r\n 	<li class=\"\" data-start=\"333\" data-end=\"427\">\r\n<p class=\"\" data-start=\"335\" data-end=\"427\"><strong data-start=\"335\" data-end=\"344\">Warna</strong>: <span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Hitam dengan cetakan logo putih</span>​</p>\r\n</li>\r\n 	<li class=\"\" data-start=\"428\" data-end=\"523\">\r\n<p class=\"\" data-start=\"430\" data-end=\"523\"><strong data-start=\"430\" data-end=\"440\">Ukuran</strong>: <span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Satu ukuran (One Size)</span>​</p>\r\n</li>\r\n 	<li class=\"\" data-start=\"524\" data-end=\"619\">\r\n<p class=\"\" data-start=\"526\" data-end=\"619\"><strong data-start=\"526\" data-end=\"534\">Tali</strong>: <span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Rantai ganda berwarna perak</span>​</p>\r\n</li>\r\n 	<li class=\"\" data-start=\"620\" data-end=\"718\">\r\n<p class=\"\" data-start=\"622\" data-end=\"718\"><strong data-start=\"622\" data-end=\"631\">Bahan</strong>: <span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Sintetis berkualitas tinggi</span>​</p>\r\n</li>\r\n 	<li class=\"\" data-start=\"719\" data-end=\"823\">\r\n<p class=\"\" data-start=\"721\" data-end=\"823\"><strong data-start=\"721\" data-end=\"736\">Kompartemen</strong>: <span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Satu ruang utama dengan penutup flap dan kancing magnetik</span>​</p>\r\n</li>\r\n 	<li class=\"\" data-start=\"824\" data-end=\"921\">\r\n<p class=\"\" data-start=\"826\" data-end=\"921\"><strong data-start=\"826\" data-end=\"834\">Logo</strong>: <span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Logo \"Steve Madden\" timbul di bagian depan</span>​</p>\r\n</li>\r\n</ul>\r\n<h3 class=\"\" data-start=\"923\" data-end=\"938\">🎯 Kegunaan</h3>\r\n<p class=\"\" data-start=\"939\" data-end=\"1064\"><span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Tas ini cocok digunakan untuk berbagai kesempatan, baik acara formal maupun kasual.</span> <span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Desainnya yang stylish membuatnya menjadi pilihan tepat untuk menambah statement pada penampilan Anda.</span></p>','Steve Madden BSPELL Women\'s Shoulder Bags - Black','<p class=\"\" data-start=\"155\" data-end=\"312\"><span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Tas ini memiliki desain yang mencolok dengan motif logo \"STEVE MADDEN\" berukuran besar yang tercetak di seluruh permukaan tas.</span></p>','publish','open','closed','','steve-madden-bspell-womens-shoulder-bags-black','','','2025-05-28 06:25:41','2025-05-28 06:25:41','',0,'http://style.local/?post_type=product&#038;p=230',0,'product','',0);
