INSERT INTO `wp_posts` VALUES (234,4,'2025-04-14 06:29:58','2025-04-14 06:29:58','<h3 class=\"\" data-start=\"128\" data-end=\"151\">✨ Desain &amp; Tampilan</h3>\r\n<p class=\"\" data-start=\"152\" data-end=\"309\"><span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Sandal hak tinggi ini menampilkan desain minimalis dan elegan dengan warna rose gold yang memikat.</span> <span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Tali-tali ramping yang melingkar di bagian depan dan pergelangan kaki memberikan sentuhan feminin dan modern.</span> <span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Hak stiletto menambah kesan anggun dan memperpanjang siluet kaki Anda.</span>​</p>\r\n\r\n\r\n<hr class=\"\" data-start=\"311\" data-end=\"314\" />\r\n\r\n<h3 class=\"\" data-start=\"316\" data-end=\"341\">📐 Spesifikasi Produk</h3>\r\n<ul data-start=\"342\" data-end=\"1043\">\r\n 	<li class=\"\" data-start=\"342\" data-end=\"436\">\r\n<p class=\"\" data-start=\"344\" data-end=\"436\"><strong data-start=\"344\" data-end=\"353\">Model</strong>: <span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">LEYTON</span></p>\r\n</li>\r\n 	<li class=\"\" data-start=\"437\" data-end=\"533\">\r\n<p class=\"\" data-start=\"439\" data-end=\"533\"><strong data-start=\"439\" data-end=\"448\">Warna</strong>: <span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Rose Gold</span>​</p>\r\n</li>\r\n 	<li class=\"\" data-start=\"534\" data-end=\"635\">\r\n<p class=\"\" data-start=\"536\" data-end=\"635\"><strong data-start=\"536\" data-end=\"548\">Tipe Hak</strong>: <span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Stiletto</span></p>\r\n</li>\r\n 	<li class=\"\" data-start=\"636\" data-end=\"734\">\r\n<p class=\"\" data-start=\"638\" data-end=\"734\"><strong data-start=\"638\" data-end=\"647\">Bahan</strong>: <span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Kulit sintetis berkualitas tinggi</span>​</p>\r\n</li>\r\n 	<li class=\"\" data-start=\"735\" data-end=\"835\">\r\n<p class=\"\" data-start=\"737\" data-end=\"835\"><strong data-start=\"737\" data-end=\"748\">Penutup</strong>: <span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Buckle di pergelangan kaki</span>​</p>\r\n</li>\r\n 	<li class=\"\" data-start=\"836\" data-end=\"944\">\r\n<p class=\"\" data-start=\"838\" data-end=\"944\"><strong data-start=\"838\" data-end=\"857\">Ukuran Tersedia</strong>: <span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">5.5 hingga 11 US</span>​</p>\r\n</li>\r\n</ul>\r\n\r\n<hr class=\"\" data-start=\"1045\" data-end=\"1048\" />\r\n\r\n<h3 class=\"\" data-start=\"1050\" data-end=\"1065\">🎯 Kegunaan</h3>\r\n<p class=\"\" data-start=\"1066\" data-end=\"1191\"><span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Sandal ini cocok untuk berbagai acara, mulai dari pesta malam, pernikahan, hingga acara formal lainnya.</span> <span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Desainnya yang chic dan warna rose gold yang elegan membuatnya mudah dipadukan dengan berbagai outfit.</span></p>','Steve Madden LEYTON Women\'s Sandal Heels- Rose Gold','<p class=\"\" data-start=\"152\" data-end=\"309\"><span class=\"relative -mx-px my-[-0.2rem] rounded px-px py-[0.2rem] transition-colors duration-100 ease-in-out\">Sandal hak tinggi ini menampilkan desain minimalis dan elegan dengan warna rose gold yang memikat.</span></p>','publish','open','closed','','steve-madden-leyton-womens-sandal-heels-rose-gold','','','2025-05-28 06:25:41','2025-05-28 06:25:41','',0,'http://style.local/?post_type=product&#038;p=234',0,'product','',0);
